<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Two Wheel Detailing - Book Now</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            background-color: #000000; /* Deep black */
            color: white;
            font-family: 'Arial', sans-serif;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 20px;
        }
        
        .form-container {
            width: 100%;
            max-width: 500px;
            background-color: #0a0a0a; /* Deep black */
            padding: 30px;
            border-radius: 10px;
            box-shadow: 0 4px 20px rgba(0, 100, 200, 0.3); /* Deep blue glow */
            border: 1px solid #0066cc; /* Deep blue border */
        }
        
        .form-title {
            text-align: center;
            margin-bottom: 25px;
            font-size: 24px;
            color: #0066cc; /* Deep blue */
        }
        
        .form-group {
            margin-bottom: 20px;
        }
        
        label {
            display: block;
            margin-bottom: 8px;
            font-weight: bold;
            color: #0066cc; /* Deep blue */
        }
        
        input, select {
            width: 100%;
            padding: 12px;
            border: 2px solid #0066cc; /* Deep blue border */
            border-radius: 5px;
            background-color: #1a1a1a; /* Darker black */
            color: white;
            font-size: 16px;
            transition: all 0.3s;
        }
        
        input:focus, select:focus {
            outline: none;
            border-color: #ffffff; /* White when focused */
            box-shadow: 0 0 10px rgba(0, 100, 200, 0.5); /* Deep blue glow */
        }
        
        .submit-btn {
            width: 100%;
            padding: 15px;
            background-color: #0066cc; /* Deep blue */
            color: #ffffff; /* White text */
            border: 2px solid #0066cc; /* Deep blue border */
            border-radius: 5px;
            font-size: 18px;
            font-weight: bold;
            cursor: pointer;
            transition: all 0.3s;
        }
        
        .submit-btn:hover:not(:disabled) {
            background-color: #ffffff; /* White on hover */
            color: #000000; /* Deep black text */
            border-color: #0066cc;
            box-shadow: 0 0 15px rgba(0, 100, 200, 0.8); /* Deep blue glow */
        }
        
        .submit-btn:disabled {
            background-color: #333333;
            border-color: #333333;
            cursor: not-allowed;
        }
        
        .message {
            margin-top: 20px;
            padding: 15px;
            border-radius: 5px;
            text-align: center;
            font-weight: bold;
        }
        
        .success {
            background-color: #00aa00; /* Darker green */
            color: #ffffff;
            border: 1px solid #00aa00;
        }
        
        .error {
            background-color: #cc0000; /* Darker red */
            color: white;
            border: 1px solid #cc0000;
        }
        
        .conflict {
            background-color: #cccc00; /* Darker yellow */
            color: #000000;
            border: 1px solid #cccc00;
        }
        
        .loading {
            background-color: #0066cc; /* Deep blue */
            color: #ffffff;
            border: 1px solid #0066cc;
        }
        
        /* Responsive adjustments */
        @media (max-width: 600px) {
            .form-container {
                padding: 20px;
                margin: 10px;
            }
            
            .form-title {
                font-size: 20px;
            }
        }
        
        .required {
            color: #cc0000; /* Darker red */
        }
        
        .price-display {
            font-weight: bold;
            color: #0066cc; /* Deep blue */
            margin-top: 5px;
            font-size: 14px;
        }
    </style>
</head>
<body>
    <!-- Image moved inside the form container -->
    <div class="form-container">
        <img id="headerImage" src="" alt="Two Wheel Detailing" style="width: 100%; max-height: 200px; object-fit: contain; border-radius: 5px; margin-bottom: 20px;" onerror="handleImageError(this)">
        
        <h2 class="form-title">Book Your Detailing Service</h2>
        
        <form id="bookingForm">
            <div class="form-group">
                <label for="name">Full Name <span class="required">*</span></label>
                <input type="text" id="name" name="name" required>
            </div>
            
            <div class="form-group">
                <label for="email">Email Address <span class="required">*</span></label>
                <input type="email" id="email" name="email" required>
            </div>
            
            <div class="form-group">
                <label for="phone">Phone Number <span class="required">*</span></label>
                <input type="tel" id="phone" name="phone" required>
            </div>
            
            <div class="form-group">
                <label for="date">Date <span class="required">*</span></label>
                <input type="date" id="date" name="date" required min="">
            </div>
            
            <div class="form-group">
                <label for="time">Time <span class="required">*</span></label>
                <select id="time" name="time" required>
                    <option value="">Select a Time Slot</option>
                    <option value="09:00">9:00 AM</option>
                    <option value="10:00">10:00 AM</option>
                    <option value="11:00">11:00 AM</option>
                    <option value="12:00">12:00 PM</option>
                    <option value="13:00">1:00 PM</option>
                    <option value="14:00">2:00 PM</option>
                    <option value="15:00">3:00 PM</option>
                    <option value="16:00">4:00 PM</option>
                </select>
            </div>
            
            <div class="form-group">
                <label for="bikeType">Motorcycle Make & Model <span class="required">*</span></label>
                <input type="text" id="bikeType" name="bikeType" placeholder="e.g., Honda CBR600RR, Yamaha MT-07" required>
            </div>
            
            <div class="form-group">
                <label for="serviceType">Service Type <span class="required">*</span></label>
                <select id="serviceType" name="serviceType" required>
                    <option value="">Select a Service</option>
                    <option value="Full Detail - R600.00">Full Detail - R600.00</option>
                    <option value="Standard Wash - R250.00">Standard Wash - R255.00</option>
                    <option value="Quick Wash - R150.00">Quick Wash - R150.00</option>
                </select>
            </div>
            
            <button type="submit" class="submit-btn" id="submitBtn">Book Now</button>
        </form>
        
        <div id="message"></div>
    </div>

        // Function to set the base64 image
        function setBase64Image() {
            const imageElement = document.getElementById('headerImage');
            
            // Validate the base64 string format
            if (!base64ImageString || base64ImageString.trim() === '') {
                console.error('No base64 string provided');
                return;
            }
            
            // Check if the string already has the data:image prefix
            if (base64ImageString.startsWith('data:image')) {
                // If it already has the prefix, use it as-is
                imageElement.src = base64ImageString;
            } else {
                // If it doesn't have the prefix, add the appropriate one
                // Determine image type based on common formats in the string
                let imageType = 'jpeg'; // Default to jpeg
                
                // Try to detect the image type from the base64 string
                if (base64ImageString.startsWith('/9j/')) {
                    imageType = 'jpeg'; // JPEG starts with /9j/
                } else if (base64ImageString.startsWith('iVBORw0KGgo')) {
                    imageType = 'png'; // PNG starts with iVBORw0KGgo
                } else if (base64ImageString.startsWith('R0lGOD')) {
                    imageType = 'gif'; // GIF starts with R0lGOD
                }
                
                // Set the image source with proper data URL format
                imageElement.src = `data:image/${imageType};base64,${base64ImageString}`;
            }
        }
        
        // Call the function to set the image
        setBase64Image();
        
        // Error handler for image loading
        function handleImageError(img) {
            console.error('Failed to load base64 image');
            img.alt = 'Image failed to load';
            img.style.backgroundColor = '#333';
            img.style.display = 'flex';
            img.style.alignItems = 'center';
            img.style.justifyContent = 'center';
            img.textContent = 'Image Not Loaded';
        }
        
        // Form submission handler
        document.getElementById('bookingForm').addEventListener('submit', async function(e) {
            e.preventDefault();
            
            const submitBtn = document.getElementById('submitBtn');
            const messageDiv = document.getElementById('message');
            
            // Show loading state
            submitBtn.disabled = true;
            submitBtn.textContent = 'Booking...';
            showMessage('Processing your booking...', 'loading');
            
            try {
                const formData = {
                    name: document.getElementById('name').value.trim(),
                    email: document.getElementById('email').value.trim(),
                    phone: document.getElementById('phone').value.trim(),
                    date: document.getElementById('date').value,
                    time: document.getElementById('time').value,
                    bikeType: document.getElementById('bikeType').value.trim(),
                    serviceType: document.getElementById('serviceType').value
                };
                
                const response = await fetch('https://broad-bird-2f68.02wheeldetailing.workers.dev/', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify(formData)
                });
                
                const result = await response.text();
                
                if (result.includes('Success')) {
                    showMessage('Booking confirmed! We\'ll contact you soon.', 'success');
                    document.getElementById('bookingForm').reset();
                } else if (result.includes('Conflict')) {
                    showMessage(result, 'conflict');
                } else if (result.includes('Error')) {
                    showMessage(result, 'error');
                } else {
                    showMessage('Unknown response. Please try again.', 'error');
                }
                
            } catch (error) {
                console.error('Submission error:', error);
                showMessage('Network error. Please check your connection and try again.', 'error');
            } finally {
                // Reset button state after delay
                setTimeout(() => {
                    submitBtn.disabled = false;
                    submitBtn.textContent = 'Book Now';
                    
                    // Clear message after 5 seconds if it's not an error
                    setTimeout(() => {
                        const currentMessage = messageDiv.querySelector('.message');
                        if (currentMessage && !currentMessage.classList.contains('error') && 
                            !currentMessage.classList.contains('conflict')) {
                            messageDiv.innerHTML = '';
                        }
                    }, 5000);
                }, 1000);
            }
        });
        
        // Helper function to show messages
        function showMessage(text, type) {
            const messageDiv = document.getElementById('message');
            messageDiv.innerHTML = `<div class="message ${type}">${text}</div>`;
        }
    </script>
